import styled from 'styled-components'
import { Component } from 'react';
// import { Division } from './../../../../todo/src/Pages/Alltodos/Style';
// import { Division } from './../../../../todo/src/Commoncomponents/Footer/Style';
export const I = styled.i`
padding:0px 10px;
`;
export const P = styled.p`
font-size:35px;
margin:0px;
color:#204393;
`;
export const Div = styled.div`
color:navy;
font-weight:bold;
`;
export const Division = styled.div`
margin:25px 0px;
`;
export const Divisionlink = styled.div`
color:#505050;
font-size:14px;
margin:10px 0px;
`;
